                               Pokemon(Name: "Litwick", types: "Ghost/Fire", DexEntry: "While shining a light and pretending to be a guide, it leeches off the life force of any who follow it.", pokedexNumber: 607, RoutesFound: "Celestial Tower, Twist Mountain, Dragonspiral Tower", Weight: "3.1 kg", Height: "0.3 m"),
                               Pokemon(Name: "Lampent", types: "Ghost/Fire", DexEntry: "It arrives near the moment of death and steals spirit from the body. It likes the funerals of Pokémon.", pokedexNumber: 608, RoutesFound: "Evolve Litwick (Level 41)", Weight: "13.0 kg", Height: "0.6 m"),
                               Pokemon(Name: "Chandelure", types: "Ghost/Fire", DexEntry: "It absorbs a spirit, which it then burns. By waving the flames on its arms, it puts its foes into a hypnotic trance.", pokedexNumber: 609, RoutesFound: "Evolve Lampent (use Dusk Stone)", Weight: "34.3 kg", Height: "1.0 m"),
                               Pokemon(Name: "Axew", types: "Dragon", DexEntry: "Their tusks can shatter rocks. Territory battles between Fraxure can be intensely violent.", pokedexNumber: 610, RoutesFound: "Mistralton Cave", Weight: "18.0 kg", Height: "0.6 m"),
                               Pokemon(Name: "Fraxure", types: "Dragon", DexEntry: "After battle, they carefully sharpens their tusks on river rocks. It needs to take care of its tusks—if one breaks, it will never grow back.", pokedexNumber: 611, RoutesFound: "Evolve Axew (Level 38)", Weight: "36.0 kg", Height: "1.0 m"),
                               Pokemon(Name: "Haxorus", types: "Dragon", DexEntry: "Their sturdy tusks will stay sharp even if used to cut steel beams. These Pokémon are covered in hard armor.", pokedexNumber: 612, RoutesFound: "Evolve Fraxure (Level 48)", Weight: "105.5 kg", Height: "1.8 m"),
                               Pokemon(Name: "Cubchoo", types: "Ice", DexEntry: "Its nose is always running. It sniffs the snot back up because the mucus provides the raw material for its moves.", pokedexNumber: 613, RoutesFound: "Route 7", Weight: "8.5 kg", Height: "0.5 m"),
                               Pokemon(Name: "Beartic", types: "Ice", DexEntry: "It can make its breath freeze at will. Very able in the water, it swims around in northern seas and catches prey.", pokedexNumber: 614, RoutesFound: "Evolve Cubchoo", Weight: "260.0 kg", Height: "2.6 m"),
                               Pokemon(Name: "Cryogonal", types: "Ice", DexEntry: "It forms when the moisture in the air freezes. It is said to make snow crystals and freeze its enemies solid.", pokedexNumber: 615, RoutesFound: "Chargestone Cave, Twist Mountain, Dragonspiral Tower", Weight: "148.0 kg", Height: "1.1 m"),
                               Pokemon(Name: "Shelmet", types: "Bug", DexEntry: "Their helmet-like shells protect their heads from damage. Even if they’re not damaged, they’re replaced with new ones when they grow.", pokedexNumber: 616, RoutesFound: "Route 8", Weight: "7.7 kg", Height: "0.4 m"),
                               Pokemon(Name: "Accelgor", types: "Bug", DexEntry: "When their body temperature increases, they cool down by excreting a liquid from their mouth. If they’re not feeling well, their mucus gets watery.", pokedexNumber: 617, RoutesFound: "Evolve Shelmet (Trade for Karrablast)", Weight: "25.3 kg", Height: "0.8 m"),
                               Pokemon(Name: "Stunfisk", types: "Ground/Electric", DexEntry: "It conceals itself in the mud of the seashore. Then it waits. When prey touch it, it delivers a jolt of electricity.", pokedexNumber: 618, RoutesFound: "Route 8, Moor of Icirrus, Driftveil City", Weight: "11.0 kg", Height: "0.7 m"),
                               Pokemon(Name: "Mienfoo", types: "Fighting", DexEntry: "As they sharpen their moves, their attacks will steal the focus of any Pokémon they hit. They will make their foes lose their will to fight.", pokedexNumber: 619, RoutesFound: "Route 10", Weight: "20.0 kg", Height: "0.9 m"),
                               Pokemon(Name: "Mienshao", types: "Fighting", DexEntry: "It’s good at both offense and defense. Eying anything it takes a shine to, it leaps at it all at once, striking with its sharp claws.", pokedexNumber: 620, RoutesFound: "Evolve Mienfoo", Weight: "35.5 kg", Height: "1.4 m"),
                               Pokemon(Name: "Druddigon", types: "Dragon", DexEntry: "It’s thought to be a type of legendary Pokémon. A strange red crest adorns its head, and it’s said to be incredibly powerful.", pokedexNumber: 621, RoutesFound: "Dragonspiral Tower", Weight: "139.0 kg", Height: "1.6 m"),
                               Pokemon(Name: "Golett", types: "Ground/Ghost", DexEntry: "These Pokémon are thought to have been created by the science of an ancient and mysterious civilization.", pokedexNumber: 622, RoutesFound: "Dragonspiral Tower", Weight: "92.0 kg", Height: "1.0 m"),
                               Pokemon(Name: "Golurk", types: "Ground/Ghost", DexEntry: "They were the guardians of an ancient city. They use their massive strength to help build transportation infrastructure.", pokedexNumber: 623, RoutesFound: "Evolve Golett", Weight: "330.0 kg", Height: "2.8 m"),
                               Pokemon(Name: "Pawniard", types: "Dark/Steel", DexEntry: "They fight at Bisharp’s command. They cling to their prey with powerful pincers and drain their blood.", pokedexNumber: 624, RoutesFound: "Route 9", Weight: "10.2 kg", Height: "0.5 m"),
                               Pokemon(Name: "Bisharp", types: "Dark/Steel", DexEntry: "A team of them patrols the streets, snipping away any trash they find. They are kind to one another, but they fight bitterly with enemy Pawniard.", pokedexNumber: 625, RoutesFound: "Evolve Pawniard (Level 52)", Weight: "70.0 kg", Height: "1.6 m"),
                               Pokemon(Name: "Bouffalant", types: "Normal", DexEntry: "Their fluffy fur absorbs damage, even if they strike foes with a fierce headbutt.", pokedexNumber: 626, RoutesFound: "Route 10", Weight: "94.6 kg", Height: "1.6 m"),
                               Pokemon(Name: "Rufflet", types: "Normal/Flying", DexEntry: "It stands up to massive opponents, not out of courage, but out of recklessness. But that is all a ploy. Its true aim is to take them down.", pokedexNumber: 627, RoutesFound: "Route 10", Weight: "10.5 kg", Height: "0.5 m"),
                               Pokemon(Name: "Braviary", types: "Normal/Flying", DexEntry: "They fight for their friends without any thought about danger to themselves. One can carry a car while flying.", pokedexNumber: 628, RoutesFound: "Evolve Rufflet (Level 54)", Weight: "41.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Vullaby", types: "Dark/Flying", DexEntry: "Parent Pokémon fly around with their babies always in tow. Every time they use a move, they leave behind a sweet scent.", pokedexNumber: 629, RoutesFound: "Route 10", Weight: "9.0 kg", Height: "0.5 m"),
                               Pokemon(Name: "Mandibuzz", types: "Dark/Flying", DexEntry: "It makes a nest out of the bones it finds. It grabs weakened prey in its talons and hauls it to its nest of bones.", pokedexNumber: 630, RoutesFound: "Evolve Vullaby (Level 54)", Weight: "39.5 kg", Height: "1.2 m"),
                               Pokemon(Name: "Heatmor", types: "Fire", DexEntry: "Using their very hot, flame-covered tongues, they burn through Durant's steel bodies and consume their insides.", pokedexNumber: 631, RoutesFound: "Route 9", Weight: "58.0 kg", Height: "1.4 m"),
                               Pokemon(Name: "Durant", types: "Bug/Steel", DexEntry: "Durant dig nests in mountains. They build their complicated, interconnected tunnels in intricate patterns.", pokedexNumber: 632, RoutesFound: "Route 9", Weight: "33.0 kg", Height: "0.3 m"),
                               Pokemon(Name: "Deino", types: "Dark/Dragon", DexEntry: "Lacking sight, it's unaware of its surroundings, so it bumps into things and eats anything that moves.", pokedexNumber: 633, RoutesFound: "Dragonspiral Tower, Victory Road", Weight: "17.3 kg", Height: "0.8 m"),
                               Pokemon(Name: "Zweilous", types: "Dark/Dragon", DexEntry: "After it has eaten up all the food in its territory, it moves to another area. Its two heads do not get along.", pokedexNumber: 634, RoutesFound: "Evolve Deino (Level 50)", Weight: "50.0 kg", Height: "1.4 m"),
                               Pokemon(Name: "Hydreigon", types: "Dark/Dragon", DexEntry: "The heads on their arms do not have brains. They use all three heads to consume and destroy everything.", pokedexNumber: 635, RoutesFound: "Evolve Zweilous (Level 64)", Weight: "160.0 kg", Height: "1.8 m"),
                               Pokemon(Name: "Larvesta", types: "Bug/Fire", DexEntry: "Larvesta's body is warm all over. It's said that this warmth is what keeps it alive during the winter.", pokedexNumber: 636, RoutesFound: "Route 18", Weight: "28.8 kg", Height: "1.1 m"),
                               Pokemon(Name: "Volcarona", types: "Bug/Fire", DexEntry: "With their fiery breath of over 5,000 degrees Fahrenheit, they fly around the spewed fire. They are thought to have a strong connection to the sun.", pokedexNumber: 637, RoutesFound: "Evolve Larvesta (Level 59)", Weight: "46.0 kg", Height: "1.6 m"),
                               Pokemon(Name: "Cobalion", types: "Steel/Fighting", DexEntry: "It has a body and heart of steel. It worked with its allies to punish people when they hurt Pokémon.", pokedexNumber: 638, RoutesFound: "Mistralton Cave", Weight: "250.0 kg", Height: "2.1 m"),
                               Pokemon(Name: "Terrakion", types: "Rock/Fighting", DexEntry: "Its charge is strong enough to break through a giant castle wall in one blow. This Pokémon is spoken of in legends.", pokedexNumber: 639, RoutesFound: "Victory Road", Weight: "260.0 kg", Height: "1.9 m"),
                               Pokemon(Name: "Virizion", types: "Grass/Fighting", DexEntry: "It races through narrow caves, using its sharp claws to catch prey. The skin on its face is harder than a rock.", pokedexNumber: 640, RoutesFound: "Pinwheel Forest", Weight: "200.0 kg", Height: "2.0 m"),
                               Pokemon(Name: "Tornadus", types: "Flying", DexEntry: "Its charged-up bolts of lightning can strike distant targets and return to its home. It's feared as a herald of destruction.", pokedexNumber: 641, RoutesFound: "Roaming Unova", Weight: "63.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Thundurus", types: "Electric/Flying", DexEntry: "From the forces of lightning and wind, Thundurus creates thunderclouds to hide when it flies. It is said to be a terrifying Pokémon.", pokedexNumber: 642, RoutesFound: "Roaming Unova", Weight: "61.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Reshiram", types: "Dragon/Fire", DexEntry: "They say that Reshiram's tail sheds a blinding light that clears the skies of darkness. This Pokémon appears in legends.", pokedexNumber: 643, RoutesFound: "N's Castle", Weight: "330.0 kg", Height: "3.2 m"),
                               Pokemon(Name: "Zekrom", types: "Dragon/Electric", DexEntry: "When it generates electricity and releases it in lightning bolts, it's impossible to hear any cries of pain over the sound of thunder.", pokedexNumber: 644, RoutesFound: "N's Castle", Weight: "345.0 kg", Height: "2.9 m"),
                               Pokemon(Name: "Landorus", types: "Ground/Flying", DexEntry: "Its form changes to summon the powers of nature to its aid. It can cause thunderstorms.", pokedexNumber: 645, RoutesFound: "Abundant Shrine", Weight: "68.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Kyurem", types: "Dragon/Ice", DexEntry: "It generates a powerful, freezing energy inside itself, but its body became frozen when the energy leaked out.", pokedexNumber: 646, RoutesFound: "Giant Chasm", Weight: "325.0 kg", Height: "3.0 m"),
                               Pokemon(Name: "Keldeo", types: "Water/Fighting", DexEntry: "It crosses the world, running over the surfaces of oceans and rivers. It appears at scenic waterfronts.", pokedexNumber: 647, RoutesFound: "Moor of Icirrus", Weight: "48.5 kg", Height: "1.4 m"),
                               Pokemon(Name: "Meloetta", types: "Normal/Psychic", DexEntry: "Its melodies are sung with a special vocalization method that can control the feelings of those who hear it.", pokedexNumber: 648, RoutesFound: "Event", Weight: "6.5 kg", Height: "0.6 m"),
                               Pokemon(Name: "Genesect", types: "Bug/Steel", DexEntry: "This ancient bug Pokémon was altered by Team Plasma. They upgraded the cannon on its back.", pokedexNumber: 649, RoutesFound: "Event", Weight: "82.5 kg", Height: "1.5 m"),
                               Pokemon(Name: "Chespin", types: "Grass", DexEntry: "It can flex the spikes on its head at will. When it's in a tight spot, these spikes can deter foes.", pokedexNumber: 650, RoutesFound: "Route 2, Route 3, Route 22", Weight: "9.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Quilladin", types: "Grass", DexEntry: "When it feels threatened, it raises the quills on its back to defend itself.", pokedexNumber: 651, RoutesFound: "Evolve Chespin", Weight: "29.0 kg", Height: "0.7 m"),
                               Pokemon(Name: "Chesnaught", types: "Grass / Fighting", DexEntry: "Its Tackle is forceful enough to flip a 50-ton tank. It shields its allies from danger with its own body.", pokedexNumber: 652, RoutesFound: "Evolve Quilladin", Weight: "90.0 kg", Height: "1.6 m"),
                               Pokemon(Name: "Fennekin", types: "Fire", DexEntry: "Eating a twig fills it with energy, and its roomy ears give vent to air hotter than 390 degrees Fahrenheit.", pokedexNumber: 653, RoutesFound: "Route 4", Weight: "9.4 kg", Height: "0.4 m"),
                               Pokemon(Name: "Braixen", types: "Fire", DexEntry: "It has a twig stuck in its tail. With friction from its tail fur, it sets the twig on fire and launches into battle.", pokedexNumber: 654, RoutesFound: "Evolve Fennekin", Weight: "14.5 kg", Height: "1.0 m"),
                               Pokemon(Name: "Delphox", types: "Fire / Psychic", DexEntry: "Using psychic power, it generates a fiery vortex of 5,400 degrees Fahrenheit, incinerating foes swept into this whirl of flame.", pokedexNumber: 655, RoutesFound: "Evolve Braixen", Weight: "39.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Froakie", types: "Water", DexEntry: "It secretes flexible bubbles from its chest and back. The bubbles reduce the damage it would otherwise take when attacked.", pokedexNumber: 656, RoutesFound: "Route 8, Route 12", Weight: "7.0 kg", Height: "0.3 m"),
                               Pokemon(Name: "Frogadier", types: "Water", DexEntry: "It can throw bubble-covered pebbles with precise control, hitting empty cans up to a hundred feet away.", pokedexNumber: 657, RoutesFound: "Evolve Froakie", Weight: "10.9 kg", Height: "0.6 m"),
                               Pokemon(Name: "Greninja", types: "Water / Dark", DexEntry: "It creates throwing stars out of compressed water. When it spins them and throws them at high speed, these stars can split metal in two.", pokedexNumber: 658, RoutesFound: "Evolve Frogadier", Weight: "40.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Bunnelby", types: "Normal", DexEntry: "It has ears like shovels. Digging holes strengthens its ears so much that they can sever thick roots effortlessly.", pokedexNumber: 659, RoutesFound: "Route 2", Weight: "5.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Diggersby", types: "Normal / Ground", DexEntry: "As powerful as an excavator, its ears can reduce dense bedrock to rubble. When it's finished digging, it lounges lazily.", pokedexNumber: 660, RoutesFound: "Evolve Bunnelby", Weight: "42.4 kg", Height: "1.0 m"),
                               Pokemon(Name: "Fletchling", types: "Normal / Flying", DexEntry: "Despite the beauty of its lilting voice, it's merciless to intruders that enter its territory.", pokedexNumber: 661, RoutesFound: "Route 2", Weight: "1.7 kg", Height: "0.3 m"),
                               Pokemon(Name: "Fletchinder", types: "Fire / Flying", DexEntry: "From its beak, it expels embers that set the tall grass on fire. Then it pounces on the bewildered prey that pop out of the grass.", pokedexNumber: 662, RoutesFound: "Evolve Fletchling", Weight: "16.0 kg", Height: "0.7 m"),
                               Pokemon(Name: "Talonflame", types: "Fire / Flying", DexEntry: "In the fever of an exciting battle, it showers embers from the gaps between its feathers and takes to the air.", pokedexNumber: 663, RoutesFound: "Evolve Fletchinder", Weight: "24.5 kg", Height: "1.2 m"),
                               Pokemon(Name: "Scatterbug", types: "Bug", DexEntry: "When under attack from bird Pokémon, it spews a poisonous black powder that causes paralysis on contact.", pokedexNumber: 664, RoutesFound: "Route 2", Weight: "2.5 kg", Height: "0.3 m"),
                               Pokemon(Name: "Spewpa", types: "Bug", DexEntry: "It lives hidden within thicket shadows. When predators attack, it quickly bristles the fur covering its body in an effort to threaten them.", pokedexNumber: 665, RoutesFound: "Evolve Scatterbug", Weight: "8.4 kg", Height: "0.3 m"),
                               Pokemon(Name: "Vivillon", types: "Bug / Flying", DexEntry: "The patterns on this Pokémon's wings depend on the climate and topography of its habitat. It scatters colorful scales.", pokedexNumber: 666, RoutesFound: "Evolve Spewpa", Weight: "17.0 kg", Height: "1.2 m"),
                               Pokemon(Name: "Litleo", types: "Fire / Normal", DexEntry: "It basks in the energy of its surroundings, which sets off a chain reaction that results in it becoming more active.", pokedexNumber: 667, RoutesFound: "Route 22", Weight: "13.5 kg", Height: "0.6 m"),
                               Pokemon(Name: "Pyroar", types: "Fire / Normal", DexEntry: "The male with the largest mane of fire becomes the leader of the pride. It defends its pride from attackers with a mane of raging flames.", pokedexNumber: 668, RoutesFound: "Evolve Litleo", Weight: "81.5 kg", Height: "1.5 m"),
                               Pokemon(Name: "Flabébé", types: "Fairy", DexEntry: "It's not safe without the power of a flower. If it's not blooming, it always hides deep in the shade.", pokedexNumber: 669, RoutesFound: "Route 4", Weight: "0.1 kg", Height: "0.1 m"),
                               Pokemon(Name: "Floette", types: "Fairy", DexEntry: "It flutters around fields of flowers and cares for flowers that are starting to wilt. It draws out the power of flowers to battle.", pokedexNumber: 670, RoutesFound: "Evolve Flabébé", Weight: "9.0 kg", Height: "0.2 m"),
                               Pokemon(Name: "Florges", types: "Fairy", DexEntry: "It's called the most beautiful of all flowers. When it finds a flower it likes, it dwells on that flower its whole life long.", pokedexNumber: 671, RoutesFound: "Evolve Floette", Weight: "10.0 kg", Height: "1.1 m"),
                               Pokemon(Name: "Skiddo", types: "Grass", DexEntry: "Thought to be one of the first Pokémon to live in harmony with humans, it has a placid disposition.", pokedexNumber: 672, RoutesFound: "Route 5", Weight: "31.0 kg", Height: "0.9 m"),
                               Pokemon(Name: "Gogoat", types: "Grass", DexEntry: "It can tell how its Trainer is feeling by subtle shifts in the grip on its horns. This empathic sense lets them run as if one being.", pokedexNumber: 673, RoutesFound: "Evolve Skiddo", Weight: "91.0 kg", Height: "1.7 m"),
                               Pokemon(Name: "Pancham", types: "Fighting", DexEntry: "It does its best to be taken seriously by its enemies, but its glare is not sufficiently intimidating. Chewing on a leaf is its trademark.", pokedexNumber: 674, RoutesFound: "Route 5", Weight: "8.0 kg", Height: "0.6 m"),
                               Pokemon(Name: "Pangoro", types: "Fighting / Dark", DexEntry: "It charges ahead and bashes its opponents like a berserker, uncaring about any hits it might take. Its arms are mighty enough to snap a telephone pole.", pokedexNumber: 675, RoutesFound: "Evolve Pancham", Weight: "136.0 kg", Height: "2.1 m"),
                               Pokemon(Name: "Furfrou", types: "Normal", DexEntry: "Historically, in the Kalos region, these Pokémon were designated as a symbol of elegance and were only permitted to nobility.", pokedexNumber: 676, RoutesFound: "Route 5", Weight: "28.0 kg", Height: "1.2 m"),
                               Pokemon(Name: "Espurr", types: "Psychic", DexEntry: "It has enough psychic energy to blast everything within 300 feet of itself, but it has no control over its power.", pokedexNumber: 677, RoutesFound: "Route 6", Weight: "3.5 kg", Height: "0.3 m"),
                               Pokemon(Name: "Meowstic", types: "Psychic", DexEntry: "When in danger, it raises its ears and releases enough psychic power to grind a 10-ton truck into dust.", pokedexNumber: 678, RoutesFound: "Evolve Espurr", Weight: "8.5 kg", Height: "0.6 m"),
                               Pokemon(Name: "Honedge", types: "Steel / Ghost", DexEntry: "If anyone dares to grab its hilt, it wraps a blue cloth around that person's arm and drains that person's life energy completely.", pokedexNumber: 679, RoutesFound: "Route 6", Weight: "2.0 kg", Height: "0.8 m"),
                               Pokemon(Name: "Doublade", types: "Steel / Ghost", DexEntry: "When Honedge evolves, it divides into two swords, which cooperate via telepathy to coordinate attacks and slash their enemies to ribbons.", pokedexNumber: 680, RoutesFound: "Evolve Honedge", Weight: "4.5 kg", Height: "0.8 m"),
                               Pokemon(Name: "Aegislash", types: "Steel / Ghost", DexEntry: "Generations of kings were attended by these Pokémon, which used their spectral power to manipulate and control people and Pokémon.", pokedexNumber: 681, RoutesFound: "Evolve Doublade", Weight: "53.0 kg", Height: "1.7 m"),
                               Pokemon(Name: "Spritzee", types: "Fairy", DexEntry: "Emitting a scent that enraptures those who smell it, this Pokémon may inhaled its opponent's vitality and cause them to grow weak.", pokedexNumber: 682, RoutesFound: "Route 7", Weight: "0.5 kg", Height: "0.2 m"),
                               Pokemon(Name: "Aromatisse", types: "Fairy", DexEntry: "Its scent is so overpowering that, unless a Trainer happens to really enjoy the smell, he or she will have a hard time walking alongside it.", pokedexNumber: 683, RoutesFound: "Evolve Spritzee", Weight: "15.5 kg", Height: "0.8 m"),
                               Pokemon(Name: "Swirlix", types: "Fairy", DexEntry: "Eating its fluffy fur with its constantly gaping mouth enables it to enter this Pokémon's body. It plays with children it likes.", pokedexNumber: 684, RoutesFound: "Route 7", Weight: "3.5 kg", Height: "0.4 m"),
                               Pokemon(Name: "Slurpuff", types: "Fairy", DexEntry: "It can distinguish the faintest of scents. It puts its sensitive sense of smell to use by helping pastry chefs in their work.", pokedexNumber: 685, RoutesFound: "Evolve Swirlix", Weight: "5.0 kg", Height: "0.8 m"),
                               Pokemon(Name: "Inkay", types: "Dark / Psychic", DexEntry: "Opponents who stare at the flashing of the light-emitting spots on its body become dazed and lose their will to fight.", pokedexNumber: 686, RoutesFound: "Route 8", Weight: "3.5 kg", Height: "0.4 m"),
                               Pokemon(Name: "Malamar", types: "Dark / Psychic", DexEntry: "It wields the most compelling hypnotic powers of any Pokémon, and it forces others to do whatever it wants.", pokedexNumber: 687, RoutesFound: "Evolve Inkay", Weight: "47.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Binacle", types: "Rock / Water", DexEntry: "It lives in seaside caves and chomps on rocks and seaweed. It also uses its claws to fight with others of its kind.", pokedexNumber: 688, RoutesFound: "Ambrette Town", Weight: "31.0 kg", Height: "0.5 m"),
                               Pokemon(Name: "Barbaracle", types: "Rock / Water", DexEntry: "When they evolve, two Binacle multiply into seven. They fight with the power of seven Binacle.", pokedexNumber: 689, RoutesFound: "Evolve Binacle", Weight: "96.0 kg", Height: "1.3 m"),
                               Pokemon(Name: "Skrelp", types: "Poison / Water", DexEntry: "It looks just like a rotten kelp. It hides from foes while storing up power for its evolution.", pokedexNumber: 690, RoutesFound: "Route 8", Weight: "7.3 kg", Height: "0.5 m"),
                               Pokemon(Name: "Dragalge", types: "Poison / Dragon", DexEntry: "This vicious Pokémon is said to have flown in ancient skies while shrieking high-pitched cries.", pokedexNumber: 691, RoutesFound: "Evolve Skrelp", Weight: "81.5 kg", Height: "1.8 m"),
                               Pokemon(Name: "Clauncher", types: "Water", DexEntry: "It stores energy by catching waves in its tail, then discharges them with great force in spectacular battles.", pokedexNumber: 692, RoutesFound: "Route 8", Weight: "8.3 kg", Height: "0.5 m"),
                               Pokemon(Name: "Clawitzer", types: "Water", DexEntry: "It compresses the water it has stored in the lump on its chest and then fires it with enough power to punch a hole through a thick sheet of iron.", pokedexNumber: 693, RoutesFound: "Evolve Clauncher", Weight: "35.3 kg", Height: "1.3 m"),
                               Pokemon(Name: "Helioptile", types: "Electric / Normal", DexEntry: "They make their home in deserts. They can generate their energy from basking in the sun, so eating food is not a requirement.", pokedexNumber: 694, RoutesFound: "Route 9", Weight: "6.0 kg", Height: "0.5 m"),
                               Pokemon(Name: "Heliolisk", types: "Electric / Normal", DexEntry: "It stimulates its muscles with electricity, boosting the strength in its legs and enabling it to run 100 yards in five seconds.", pokedexNumber: 695, RoutesFound: "Evolve Helioptile", Weight: "21.0 kg", Height: "1.0 m"),
                               Pokemon(Name: "Tyrunt", types: "Rock / Dragon", DexEntry: "This Pokémon was restored from a fossil. If something happens that it doesn't like, it throws a tantrum and runs wild.", pokedexNumber: 696, RoutesFound: "Glittering Cave", Weight: "26.0 kg", Height: "0.8 m"),
                               Pokemon(Name: "Tyrantrum", types: "Rock / Dragon", DexEntry: "Nothing could stop this Pokémon 100 million years ago, so it behaved like a king.", pokedexNumber: 697, RoutesFound: "Evolve Tyrunt", Weight: "270.0 kg", Height: "2.5 m"),
                               Pokemon(Name: "Amaura", types: "Rock / Ice", DexEntry: "This ancient Pokémon was restored from part of its body that had been frozen in ice for over 100 million years.", pokedexNumber: 698, RoutesFound: "Glittering Cave", Weight: "25.2 kg", Height: "1.3 m"),
                               Pokemon(Name: "Aurorus", types: "Rock / Ice", DexEntry: "The diamond-shaped crystals on its body expel air as cold as -240 degrees Fahrenheit, surrounding its enemies and encasing them in ice.", pokedexNumber: 699, RoutesFound: "Evolve Amaura", Weight: "225.0 kg", Height: "2.7 m"),
                               Pokemon(Name: "Sylveon", types: "Fairy", DexEntry: "It wraps its ribbonlike feelers around the arm of its beloved Trainer and walks with him or her.", pokedexNumber: 700, RoutesFound: "Evolve Eevee (Affection + Fairy Move)", Weight: "23.5 kg", Height: "1.0 m"),
                               Pokemon(Name: "Hawlucha", types: "Fighting / Flying", DexEntry: "It drives its opponents to exhaustion with its agile maneuvers, then ends the fight with a flashy finishing move.", pokedexNumber: 701, RoutesFound: "Route 10", Weight: "21.5 kg", Height: "0.8 m"),
                               Pokemon(Name: "Dedenne", types: "Electric / Fairy", DexEntry: "It uses its tail to absorb electricity from power plants or from outlets in houses, and then it fires the electricity from its whiskers.", pokedexNumber: 702, RoutesFound: "Route 11", Weight: "2.2 kg", Height: "0.2 m"),
                               Pokemon(Name: "Carbink", types: "Rock / Fairy", DexEntry: "Born from the high temperatures and pressures deep underground, it defends itself by firing beams from the jewel part of its body.", pokedexNumber: 703, RoutesFound: "Reflection Cave", Weight: "5.7 kg", Height: "0.3 m"),
                               Pokemon(Name: "Goomy", types: "Dragon", DexEntry: "The weakest Dragon-type Pokémon, it lives in damp, shady places, so its body doesn't dry out.", pokedexNumber: 704, RoutesFound: "Route 14", Weight: "2.8 kg", Height: "0.3 m"),
                               Pokemon(Name: "Sliggoo", types: "Dragon", DexEntry: "Its four horns are a high-performance radar system. It uses them to sense sounds and smells, rather than using ears or a nose.", pokedexNumber: 705, RoutesFound: "Evolve Goomy (Rain)", Weight: "17.5 kg", Height: "0.8 m"),
                               Pokemon(Name: "Goodra", types: "Dragon", DexEntry: "It attacks enemies with strikes of its fearsome, oversized retractable horns. It can also emit a powerful slime.", pokedexNumber: 706, RoutesFound: "Evolve Sliggoo (Level 50)", Weight: "150.5 kg", Height: "2.0 m"),
                               Pokemon(Name: "Klefki", types: "Steel / Fairy", DexEntry: "These key collectors threaten any attackers by fiercely jingling their keys at them.", pokedexNumber: 707, RoutesFound: "Route 15", Weight: "3.0 kg", Height: "0.2 m"),
                               Pokemon(Name: "Phantump", types: "Ghost / Grass", DexEntry: "These Pokémon are created when spirits possess rotten tree stumps. They prefer to live in abandoned forests.", pokedexNumber: 708, RoutesFound: "Route 16", Weight: "7.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Trevenant", types: "Ghost / Grass", DexEntry: "These Pokémon are stumps possessed by the spirits of children who died in the forest. Their cries sound like eerie screams.", pokedexNumber: 709, RoutesFound: "Evolve Phantump (Trade)", Weight: "71.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Pumpkaboo", types: "Ghost / Grass", DexEntry: "They carry a mask that used to be its face when it was human. Sometimes they look at it and cry.", pokedexNumber: 710, RoutesFound: "Route 16", Weight: "5.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Gourgeist", types: "Ghost / Grass", DexEntry: "Singing in eerie voices, they wander town streets on the night of the new moon. Anyone who hears their song is cursed.", pokedexNumber: 711, RoutesFound: "Evolve Pumpkaboo (Trade)", Weight: "12.5 kg", Height: "0.9 m"),
                               Pokemon(Name: "Bergmite", types: "Ice", DexEntry: "They block paths with their icy bodies. Glaceon and other Pokémon can't move them, so they're able to freeze areas of water.", pokedexNumber: 712, RoutesFound: "Frost Cavern", Weight: "99.5 kg", Height: "1.0 m"),
                               Pokemon(Name: "Avalugg", types: "Ice", DexEntry: "Born from icicles in snow clouds, this Pokémon's body temperature is less than -290 degrees Fahrenheit.", pokedexNumber: 713, RoutesFound: "Evolve Bergmite", Weight: "505.0 kg", Height: "2.0 m"),
                               Pokemon(Name: "Noibat", types: "Flying / Dragon", DexEntry: "Even a robust wrestler will become dizzy and unable to stand when exposed to this Pokémon's 200,000-hertz ultrasonic waves.", pokedexNumber: 714, RoutesFound: "Route 11", Weight: "8.0 kg", Height: "0.5 m"),
                               Pokemon(Name: "Noivern", types: "Flying / Dragon", DexEntry: "Flying through the darkness, it uses ultrasonic waves to identify the locations of obstacles and disorient prey.", pokedexNumber: 715, RoutesFound: "Evolve Noibat (Level 48)", Weight: "85.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Xerneas", types: "Fairy", DexEntry: "Legends say it can share eternal life. It slept for a thousand years in the form of a tree before its revival.", pokedexNumber: 716, RoutesFound: "Geosenge Town", Weight: "215.0 kg", Height: "3.0 m"),
                               Pokemon(Name: "Yveltal", types: "Dark / Flying", DexEntry: "When this legendary Pokémon's wings and tail feathers spread wide and glow red, it absorbs the life force of living creatures.", pokedexNumber: 717, RoutesFound: "Team Flare HQ", Weight: "203.0 kg", Height: "5.8 m"),
                               Pokemon(Name: "Zygarde", types: "Dragon / Ground", DexEntry: "This is Zygarde's form at times when it senses that the ecosystem is in danger. It's said to monitor the ecosystem.", pokedexNumber: 718, RoutesFound: "Terminus Cave", Weight: "305.0 kg", Height: "1.2 m"),
                               Pokemon(Name: "Diancie", types: "Rock / Fairy", DexEntry: "A sudden transformation of Carbink, its pink, glimmering body is said to be the loveliest sight in the whole world.", pokedexNumber: 719, RoutesFound: "Event Only", Weight: "8.8 kg", Height: "0.7 m"),
                               Pokemon(Name: "Hoopa", types: "Psychic / Ghost", DexEntry: "This troublemaker sends anything and everything to faraway places using its loop, which can warp space.", pokedexNumber: 720, RoutesFound: "Event Only", Weight: "9.0 kg", Height: "0.5 m"),
                               Pokemon(Name: "Volcanion", types: "Fire / Water", DexEntry: "It expels its internal steam from the arms on its back. It has enough power to blow away a mountain.", pokedexNumber: 721, RoutesFound: "Event Only", Weight: "195.0 kg", Height: "1.7 m"),
                               Pokemon(Name: "Rowlet", types: "Grass / Flying", DexEntry: "It sends its feathers, which are as sharp as blades, flying in attack. Its legs are strong, so its kicks are also formidable.", pokedexNumber: 722, RoutesFound: "Starter Pokemon", Weight: "1.5 kg", Height: "0.3 m"),
                               Pokemon(Name: "Dartrix", types: "Grass / Flying", DexEntry: "This narcissistic Pokémon is a clean freak. If its leafy afro is ruffled, it loses its focus and can't do its job.", pokedexNumber: 723, RoutesFound: "Evolve Rowlet", Weight: "16.0 kg", Height: "0.7 m"),
                               Pokemon(Name: "Decidueye", types: "Grass / Ghost", DexEntry: "Although basically cool and cautious, when it's caught by surprise, it's seized by panic.", pokedexNumber: 724, RoutesFound: "Evolve Dartrix", Weight: "36.6 kg", Height: "1.6 m"),
                               Pokemon(Name: "Litten", types: "Fire", DexEntry: "While grooming itself, it builds up fur inside its stomach. It sets the fur alight and spews fiery attacks, which change based on how it coughs.", pokedexNumber: 725, RoutesFound: "Starter Pokemon", Weight: "4.3 kg", Height: "0.4 m"),
                               Pokemon(Name: "Torracat", types: "Fire", DexEntry: "Torracat's emotions cause a rise in the organ near its throat, and it spews flaming fur from its mouth. When in trouble, it emits cries that sound like cries of a baby.", pokedexNumber: 726, RoutesFound: "Evolve Litten", Weight: "25.0 kg", Height: "0.7 m"),
                               Pokemon(Name: "Incineroar", types: "Fire / Dark", DexEntry: "Incineroar's rough and aggressive behavior is its most notable trait, but the way it helps out small Pokémon shows that it has a kind side as well.", pokedexNumber: 727, RoutesFound: "Evolve Torracat", Weight: "83.0 kg", Height: "1.8 m"),
                               Pokemon(Name: "Popplio", types: "Water", DexEntry: "Popplio can snort bubbles through its nose that it then uses as part of its battle strategy, which can be very effective.", pokedexNumber: 728, RoutesFound: "Starter Pokemon", Weight: "7.5 kg", Height: "0.4 m"),
                               Pokemon(Name: "Brionne", types: "Water", DexEntry: "Popplio gets excited whenever it sees a beautiful seashell. This Pokémon is better at moving in the water than on land.", pokedexNumber: 729, RoutesFound: "Evolve Popplio", Weight: "17.5 kg", Height: "0.6 m"),
                               Pokemon(Name: "Primarina", types: "Water / Fairy", DexEntry: "In the moonlight, this Pokémon's singing voice is particularly beautiful. It is said to be the most divine when the moon is out.", pokedexNumber: 730, RoutesFound: "Evolve Brionne", Weight: "44.0 kg", Height: "1.8 m"),
                               Pokemon(Name: "Pikipek", types: "Normal / Flying", DexEntry: "It can peck at a rate of 16 times a second to drill holes in trees. It uses the holes for food storage and for nesting.", pokedexNumber: 731, RoutesFound: "Route 1, Route 4", Weight: "1.2 kg", Height: "0.3 m"),
                               Pokemon(Name: "Trumbeak", types: "Normal / Flying", DexEntry: "It eats berries and stores their seeds in its beak. When it encounters enemies or prey, it fires off all the seeds in a burst.", pokedexNumber: 732, RoutesFound: "Evolve Pikipek", Weight: "14.8 kg", Height: "0.6 m"),
                               Pokemon(Name: "Toucannon", types: "Normal / Flying", DexEntry: "When it battles, its beak heats up. The temperature can easily exceed 212 degrees Fahrenheit, causing severe burns when it hits.", pokedexNumber: 733, RoutesFound: "Evolve Trumbeak", Weight: "26.0 kg", Height: "1.1 m"),
                               Pokemon(Name: "Yungoos", types: "Normal", DexEntry: "It wanders around in a never-ending search for food. At dusk, it collapses from exhaustion and falls asleep on the spot.", pokedexNumber: 734, RoutesFound: "Route 1, Route 2", Weight: "6.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Gumshoos", types: "Normal", DexEntry: "It adores having Rattata and Raticate for dinner, but as it's diurnal, it never encounters them. This Pokémon boasts incredible patience.", pokedexNumber: 735, RoutesFound: "Evolve Yungoos", Weight: "14.2 kg", Height: "0.7 m"),
                               Pokemon(Name: "Grubbin", types: "Bug", DexEntry: "Its strong jaw enables it to scrape trees and slurp out the sap. It normally lives underground.", pokedexNumber: 736, RoutesFound: "Route 1, Route 2", Weight: "4.4 kg", Height: "0.4 m"),
                               Pokemon(Name: "Charjabug", types: "Bug / Electric", DexEntry: "Its body is capable of storing electricity. On camping trips, people are grateful to have one around.", pokedexNumber: 737, RoutesFound: "Evolve Grubbin", Weight: "10.5 kg", Height: "0.5 m"),
                               Pokemon(Name: "Vikavolt", types: "Bug / Electric", DexEntry: "It builds up electricity in its abdomen, focuses it through its jaws, and then fires the electricity off in concentrated beams.", pokedexNumber: 738, RoutesFound: "Evolve Charjabug (Vast Poni Canyon)", Weight: "45.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Crabrawler", types: "Fighting", DexEntry: "It punches so much, its pincers often come off from overuse, but they grow back quickly. What little meat they contain is rich and delicious.", pokedexNumber: 739, RoutesFound: "Route 2, Route 3", Weight: "7.0 kg", Height: "0.6 m"),
                               Pokemon(Name: "Crabominable", types: "Fighting / Ice", DexEntry: "It aimed for the top but got lost and ended up on a snowy mountain. Being forced to endure the cold, this Pokémon evolved and grew fur.", pokedexNumber: 740, RoutesFound: "Evolve Crabrawler (Mount Lanakila)", Weight: "180.0 kg", Height: "1.7 m"),
                               Pokemon(Name: "Oricorio", types: "Flying", DexEntry: "The dancing performed by Oricorio is elegant and beautiful. Those who become captivated by its dance will be seen gathering in crowds around it.", pokedexNumber: 741, RoutesFound: "Melemele Island, Akala Island, Ula'ula Island, Poni Island", Weight: "3.4 kg", Height: "0.6 m"),
                               Pokemon(Name: "Cutiefly", types: "Bug / Fairy", DexEntry: "It feeds on the nectar and pollen of flowers. Because it's able to sense auras, it can identify which flowers are about to bloom.", pokedexNumber: 742, RoutesFound: "Melemele Meadow", Weight: "0.2 kg", Height: "0.1 m"),
                               Pokemon(Name: "Ribombee", types: "Bug / Fairy", DexEntry: "It rolls up pollen into puffs. It makes many different varieties, some used as food and others used in battle.", pokedexNumber: 743, RoutesFound: "Evolve Cutiefly", Weight: "0.5 kg", Height: "0.2 m"),
                               Pokemon(Name: "Rockruff", types: "Rock", DexEntry: "This Pokémon has lived with people since times long ago. It can sense when its Trainer is in the dumps and will stick close by its Trainer's side.", pokedexNumber: 744, RoutesFound: "Ten Carat Hill, Route 1, Route 4", Weight: "9.2 kg", Height: "0.5 m"),
                               Pokemon(Name: "Lycanroc", types: "Rock", DexEntry: "When properly raised from a young age, it will become a trustworthy partner that will absolutely never betray its Trainer.", pokedexNumber: 745, RoutesFound: "Evolve Rockruff (Level 25, Day)", Weight: "25.0 kg", Height: "0.8 m"),
                               Pokemon(Name: "Wishiwashi", types: "Water", DexEntry: "When it's in trouble, its eyes moisten and begin to shine. The shining light attracts its comrades, and they stand together against their enemies.", pokedexNumber: 746, RoutesFound: "Route 7, Brooklet Hill, Kala'e Bay", Weight: "0.3 kg", Height: "0.2 m"),
                               Pokemon(Name: "Mareanie", types: "Poison / Water", DexEntry: "It's found crawling on beaches and seafloors. The coral that grows on Corsola's head is as good as a five-star banquet to this Pokémon.", pokedexNumber: 747, RoutesFound: "Melemele Sea", Weight: "8.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Toxapex", types: "Poison / Water", DexEntry: "The spiny protrusions that cover its body are highly poisonous. If they pierce its skin, it releases toxic spikes.", pokedexNumber: 748, RoutesFound: "Evolve Mareanie", Weight: "14.5 kg", Height: "0.7 m"),
                               Pokemon(Name: "Mudbray", types: "Ground", DexEntry: "It has a stubborn, individualistic disposition. Eating dirt, making mud, and playing in the mire all form part of its daily routine.", pokedexNumber: 749, RoutesFound: "Route 4, Paniola Ranch", Weight: "110.0 kg", Height: "1.0 m"),
                               Pokemon(Name: "Mudsdale", types: "Ground", DexEntry: "It can break even large rocks with kicks of its mighty legs. Its brute strength lets it pick up a large truck and hurl it over 300 feet.", pokedexNumber: 750, RoutesFound: "Evolve Mudbray", Weight: "920.0 kg", Height: "2.5 m"),
                               Pokemon(Name: "Dewpider", types: "Water / Bug", DexEntry: "It crawls onto the land in search of food. Its water bubble allows it to breathe and protects its soft head.", pokedexNumber: 751, RoutesFound: "Brooklet Hill", Weight: "4.0 kg", Height: "0.3 m"),
                               Pokemon(Name: "Araquanid", types: "Water / Bug", DexEntry: "When it gets water on its 2.5-meter tentacles, it creates a thick, slimy poison. The foam prevents the poison from spreading.", pokedexNumber: 752, RoutesFound: "Evolve Dewpider", Weight: "82.0 kg", Height: "1.8 m"),
                               Pokemon(Name: "Fomantis", types: "Grass", DexEntry: "During the day, it sleeps and soaks up light. When night falls, it walks around looking for a safer place to sleep.", pokedexNumber: 753, RoutesFound: "Lush Jungle", Weight: "1.5 kg", Height: "0.3 m"),
                               Pokemon(Name: "Lurantis", types: "Grass", DexEntry: "It fires beams from its sickle-shaped petals. These beams are powerful enough to cleave through thick metal sheets.", pokedexNumber: 754, RoutesFound: "Evolve Fomantis", Weight: "18.5 kg", Height: "0.9 m"),
                               Pokemon(Name: "Morelull", types: "Grass / Fairy", DexEntry: "It scatters spores that flicker and glow. Anyone seeing these lights falls into a deep slumber.", pokedexNumber: 755, RoutesFound: "Lush Jungle, Mount Lanakila", Weight: "1.5 kg", Height: "0.2 m"),
                               Pokemon(Name: "Shiinotic", types: "Grass / Fairy", DexEntry: "Forests where Shiinotic live are treacherous to enter at night. People confused by its strange lights can never find their way home again.", pokedexNumber: 756, RoutesFound: "Evolve Morelull", Weight: "11.5 kg", Height: "1.0 m"),
                               Pokemon(Name: "Salandit", types: "Poison / Fire", DexEntry: "Only female Salandit exist. They emit a gas laden with pheromones to captivate male Salandit. If a fight breaks out between females, the loser is expelled from the group.", pokedexNumber: 757, RoutesFound: "Route 8", Weight: "4.8 kg", Height: "0.6 m"),
                               Pokemon(Name: "Salazzle", types: "Poison / Fire", DexEntry: "It punishes Salandit that couldn't bring it food with a fierce slap of its flame-spewing palm. Salazzle lives deep in caves and forces the Salandit it has attracted with its pheromones to serve it.", pokedexNumber: 758, RoutesFound: "Evolve Salandit (Female Only)", Weight: "22.2 kg", Height: "1.2 m"),
                               Pokemon(Name: "Stufful", types: "Normal / Fighting", DexEntry: "If you see one rubbing its cheek against a tree, you can bet it's marking its territory, but don't worry—it's not sharpening its claws.", pokedexNumber: 759, RoutesFound: "Route 8", Weight: "6.8 kg", Height: "0.5 m"),
                               Pokemon(Name: "Bewear", types: "Normal / Fighting", DexEntry: "This immensely dangerous Pokémon possesses overwhelming physical strength. Its habitat is generally off-limits.", pokedexNumber: 760, RoutesFound: "Evolve Stufful", Weight: "135.0 kg", Height: "2.1 m"),
                               Pokemon(Name: "Bounsweet", types: "Grass", DexEntry: "When it trusts a Trainer, it will treat it to berries it's decorated with cream.", pokedexNumber: 761, RoutesFound: "Lush Jungle", Weight: "3.2 kg", Height: "0.3 m"),
                               Pokemon(Name: "Steenee", types: "Grass", DexEntry: "It's quite the actress, so Steenee can make even the most detailed lie convincing. Many Trainers are taken in by its SOS signals and often bring it home.", pokedexNumber: 762, RoutesFound: "Evolve Bounsweet", Weight: "8.2 kg", Height: "0.7 m"),
                               Pokemon(Name: "Tsareena", types: "Grass", DexEntry: "It requires a lot of effort to maintain Tsareena's gorgeous, vividly colored leaves. But some collectors enjoy this work and treat it as their hobby.", pokedexNumber: 763, RoutesFound: "Evolve Steenee", Weight: "21.4 kg", Height: "1.2 m"),
                               Pokemon(Name: "Comfey", types: "Fairy", DexEntry: "It attaches flowers to its highly nutritious vine. This revitalizes the flowers, and they give off an aromatic scent.", pokedexNumber: 764, RoutesFound: "Route 2", Weight: "0.3 kg", Height: "0.1 m"),
                               Pokemon(Name: "Oranguru", types: "Normal / Psychic", DexEntry: "Deep in the jungle, high in the lofty canopy, this Pokémon abides. On rare occasions, it shows up at the beach to match wits with Slowking.", pokedexNumber: 765, RoutesFound: "Lush Jungle", Weight: "76.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Passimian", types: "Fighting", DexEntry: "They form groups of roughly 20 individuals. Their mutual bond is remarkable—they will never let down a comrade.", pokedexNumber: 766, RoutesFound: "Lush Jungle", Weight: "82.8 kg", Height: "2.0 m"),
                               Pokemon(Name: "Wimpod", types: "Bug / Water", DexEntry: "Wimpod gather in swarms, constantly on the lookout for danger. They scatter the moment they detect an enemy's presence.", pokedexNumber: 767, RoutesFound: "Route 8, Route 16, Poni Breaker Coast", Weight: "12.0 kg", Height: "0.5 m"),
                               Pokemon(Name: "Golisopod", types: "Bug / Water", DexEntry: "It battles skillfully with its six arms, but spends most of its time peacefully meditating in caves deep beneath the sea.", pokedexNumber: 768, RoutesFound: "Evolve Wimpod (Level 30)", Weight: "108.0 kg", Height: "2.0 m"),
                               Pokemon(Name: "Sandygast", types: "Ghost / Ground", DexEntry: "Born from a sand mound playfully built by a child, this Pokémon embodies the grudges of the departed.", pokedexNumber: 769, RoutesFound: "Hau'oli Cemetery, Route 4, Route 6", Weight: "70.0 kg", Height: "0.5 m"),
                               Pokemon(Name: "Palossand", types: "Ghost / Ground", DexEntry: "Buried beneath the castle are masses of dried-up bones from those whose vitality it has drained.", pokedexNumber: 770, RoutesFound: "Evolve Sandygast", Weight: "250.0 kg", Height: "1.3 m"),
                               Pokemon(Name: "Pyukumuku", types: "Water", DexEntry: "This Pokémon can spit a sticky, poisonous liquid. If it gets on you, you'll be incapacitated.", pokedexNumber: 771, RoutesFound: "Hano Beach", Weight: "1.2 kg", Height: "0.3 m"),
                               Pokemon(Name: "Type: Null", types: "Normal", DexEntry: "Apparently, Type: Null can change its type at will. Its volatile genetic makeup is unstable, so it could evolve if its base structure was to be modified or deleted.", pokedexNumber: 772, RoutesFound: "Aether Paradise", Weight: "120.5 kg", Height: "1.9 m"),
                               Pokemon(Name: "Silvally", types: "Normal", DexEntry: "This Pokémon changes its type according to its environment, enhancing its abilities in battle.", pokedexNumber: 773, RoutesFound: "Evolve Type: Null", Weight: "100.5 kg", Height: "2.3 m"),
                               Pokemon(Name: "Minior", types: "Rock / Flying", DexEntry: "When its shell breaks, the core in its center is revealed. You won't even have time to blink before it fires off a burst of energy.", pokedexNumber: 774, RoutesFound: "Ula'ula Island", Weight: "40.0 kg", Height: "0.3 m"),
                               Pokemon(Name: "Komala", types: "Normal", DexEntry: "It is born asleep, and it dies asleep. All its movements are apparently no more than the results of it tossing and turning in its dreams.", pokedexNumber: 775, RoutesFound: "Route 11", Weight: "19.9 kg", Height: "0.4 m"),
                               Pokemon(Name: "Turtonator", types: "Fire / Dragon", DexEntry: "It gushes fire and poisonous gases from its nostrils. Its dung is an explosive substance and can be put to various uses.", pokedexNumber: 776, RoutesFound: "Route 12, Blush Mountain", Weight: "212.0 kg", Height: "2.0 m"),
                               Pokemon(Name: "Togedemaru", types: "Electric / Steel", DexEntry: "When it's surprised or agitated, the 14 fur spikes on its back will stand up involuntarily.", pokedexNumber: 777, RoutesFound: "Route 1, Route 4", Weight: "3.3 kg", Height: "0.3 m"),
                               Pokemon(Name: "Mimikyu", types: "Ghost / Fairy", DexEntry: "A lonely Pokémon, it conceals its terrifying appearance beneath an old rag so it can get closer to people and other Pokémon.", pokedexNumber: 778, RoutesFound: "Thrifty Megamart", Weight: "0.7 kg", Height: "0.2 m"),
                               Pokemon(Name: "Bruxish", types: "Water / Psychic", DexEntry: "It stuns its prey with psychokinesis and then grinds them to mush with its strong teeth. Even Shellder's shell is no match for it.", pokedexNumber: 779, RoutesFound: "Route 13, Secluded Shore, Seafolk Village", Weight: "19.0 kg", Height: "0.9 m"),
                               Pokemon(Name: "Drampa", types: "Normal / Dragon", DexEntry: "Drampa is a kind and friendly Pokémon—up until it's angered. When that happens, it stirs up a gale and flattens everything around.", pokedexNumber: 780, RoutesFound: "Mount Lanakila", Weight: "185.0 kg", Height: "3.0 m"),
                               Pokemon(Name: "Dhelmise", types: "Ghost / Grass", DexEntry: "Swinging its massive anchor, it can KO Wailord in a single blow. What appears to be green seaweed is actually its body.", pokedexNumber: 781, RoutesFound: "Seafolk Village", Weight: "210.0 kg", Height: "3.9 m"),
                               Pokemon(Name: "Jangmo-o", types: "Dragon", DexEntry: "It expresses its feelings by smacking its scales. Metallic sounds echo through the tall mountains where Jangmo-o lives.", pokedexNumber: 782, RoutesFound: "Vast Poni Canyon", Weight: "29.7 kg", Height: "0.6 m"),
                               Pokemon(Name: "Hakamo-o", types: "Dragon / Fighting", DexEntry: "It leaps at its prey with a courageous shout. Its scaly punches tear its opponents to shreds.", pokedexNumber: 783, RoutesFound: "Evolve Jangmo-o", Weight: "47.0 kg", Height: "1.2 m"),
                               Pokemon(Name: "Kommo-o", types: "Dragon / Fighting", DexEntry: "It triggers a fight with others by opening its shell―truly, it is a coward at heart. In stark contrast, it's also a hard worker.", pokedexNumber: 784, RoutesFound: "Evolve Hakamo-o", Weight: "78.2 kg", Height: "1.6 m"),
                               Pokemon(Name: "Tapu Koko", types: "Electric / Fairy", DexEntry: "It confuses its enemies by flying too quickly for the eye to follow. It has a hair-trigger temper but forgets what made it angry an instant later.", pokedexNumber: 785, RoutesFound: "Ruins of Conflict", Weight: "20.5 kg", Height: "1.8 m"),
                               Pokemon(Name: "Tapu Lele", types: "Psychic / Fairy", DexEntry: "This guardian deity of Akala is guilelessly cruel. The fragrant aroma of flowers is the source of its energy.", pokedexNumber: 786, RoutesFound: "Ruins of Life", Weight: "18.6 kg", Height: "1.2 m"),
                               Pokemon(Name: "Tapu Bulu", types: "Grass / Fairy", DexEntry: "This guardian deity of Ula'ula controls plants. It heats up the area when it's angry.", pokedexNumber: 787, RoutesFound: "Ruins of Abundance", Weight: "45.5 kg", Height: "1.9 m"),
                               Pokemon(Name: "Tapu Fini", types: "Water / Fairy", DexEntry: "This guardian deity of Poni was known as the cocoon of the stars. Its body is covered in scales made of water.", pokedexNumber: 788, RoutesFound: "Ruins of Hope", Weight: "21.2 kg", Height: "1.3 m"),
                               Pokemon(Name: "Cosmog", types: "Psychic", DexEntry: "It's hypothesized that it's a type of Ultra Beast. When its eyes gleam gold, it can create a Cosmoem.", pokedexNumber: 789, RoutesFound: "Lake of the Sunne, Lake of the Moone", Weight: "0.1 kg", Height: "0.2 m"),
                               Pokemon(Name: "Cosmoem", types: "Psychic", DexEntry: "Motionless as if dead, its body is faintly warm to the touch. In the distant past, it was called the cocoon of the stars.", pokedexNumber: 790, RoutesFound: "Evolve Cosmog (Level 43)", Weight: "999.9 kg", Height: "0.1 m"),
                               Pokemon(Name: "Solgaleo", types: "Psychic / Steel", DexEntry: "Its body shines with light of a blazing sun. It is said to be an emissary of the sun.", pokedexNumber: 791, RoutesFound: "Altar of the Sunne", Weight: "230.0 kg", Height: "3.4 m"),
                               Pokemon(Name: "Lunala", types: "Psychic / Ghost", DexEntry: "Said to live in another world, this Pokémon devours light, drawing the moonless dark veil of night over the brightness of day.", pokedexNumber: 792, RoutesFound: "Altar of the Moone", Weight: "120.0 kg", Height: "4.0 m"),
                               Pokemon(Name: "Nihilego", types: "Rock / Poison", DexEntry: "One of the mysterious Ultra Beasts. Witnesses saw it pulverize a dump truck with a single punch.", pokedexNumber: 793, RoutesFound: "Ultra Space", Weight: "55.5 kg", Height: "1.2 m"),
                               Pokemon(Name: "Buzzwole", types: "Bug / Fighting", DexEntry: "One of the dangerous Ultra Beasts, it has been spotted running across the land at terrific speeds.", pokedexNumber: 794, RoutesFound: "Ultra Space", Weight: "333.6 kg", Height: "2.4 m"),
                               Pokemon(Name: "Pheromosa", types: "Bug / Fighting", DexEntry: "One of the dangerous Ultra Beasts, it has been spotted running across the land at terrific speeds.", pokedexNumber: 795, RoutesFound: "Ultra Space", Weight: "25.0 kg", Height: "1.8 m"),
                               Pokemon(Name: "Xurkitree", types: "Electric", DexEntry: "One of the mysterious life-forms known as Ultra Beasts. Astonishing electric shocks emanate from its entire body, according to witnesses.", pokedexNumber: 796, RoutesFound: "Ultra Space", Weight: "100.0 kg", Height: "3.8 m"),
                               Pokemon(Name: "Celesteela", types: "Steel / Flying", DexEntry: "It appeared from the Ultra Wormhole. Witnesses observed it flying across the sky at high speed.", pokedexNumber: 797, RoutesFound: "Ultra Space", Weight: "999.9 kg", Height: "9.2 m"),
                               Pokemon(Name: "Kartana", types: "Grass / Steel", DexEntry: "One of the Ultra Beasts. It's unclear whether or not this Pokémon is sentient, but sometimes it can be observed behaving like a young girl.", pokedexNumber: 798, RoutesFound: "Ultra Space", Weight: "0.1 kg", Height: "0.3 m"),
                               Pokemon(Name: "Guzzlord", types: "Dark / Dragon", DexEntry: "One of the mysterious Ultra Beasts. Witnesses have seen it pulverize a dump truck with its six arms.", pokedexNumber: 799, RoutesFound: "Ultra Space", Weight: "888.0 kg", Height: "5.5 m"),
                               Pokemon(Name: "Necrozma", types: "Psychic", DexEntry: "Reminiscent of the Ultra Beasts, this life-form, apparently asleep underground, is thought to have come from another world in ancient times.", pokedexNumber: 800, RoutesFound: "Mount Lanakila", Weight: "230.0 kg", Height: "2.4 m"),
                               Pokemon(Name: "Magearna", types: "Steel / Fairy", DexEntry: "This artificial Pokémon, constructed more than 500 years ago, can understand human speech but cannot itself speak.", pokedexNumber: 801, RoutesFound: "Hau'oli City", Weight: "80.5 kg", Height: "1.0 m"),
                               Pokemon(Name: "Marshadow", types: "Fighting / Ghost", DexEntry: "It lurks in the shadows of others, copying their movements and powers. This Pokémon is craven and cowering.", pokedexNumber: 802, RoutesFound: "Event Only", Weight: "22.2 kg", Height: "0.7 m"),
                               Pokemon(Name: "Poipole", types: "Poison", DexEntry: "This Ultra Beast is well enough liked to be chosen as a first partner in its own world.", pokedexNumber: 803, RoutesFound: "Ultra Megalopolis", Weight: "1.8 kg", Height: "0.6 m"),
                                 Pokemon(Name: "Naganadel", types: "Poison / Dragon", DexEntry: "It stores hundreds of liters of poisonous liquid inside its body. It is one of the organisms known as UB Stingers.", pokedexNumber: 804, RoutesFound: "Evolve Poipole", Weight: "150.0 kg", Height: "3.6 m"),
                                 Pokemon(Name: "Stakataka", types: "Rock / Steel", DexEntry: "It appeared from an Ultra Wormhole. Each one appears to be made up of many life-forms stacked one on top of each other.", pokedexNumber: 805, RoutesFound: "Ultra Deep Sea", Weight: "820.0 kg", Height: "5.5 m"),
                                 Pokemon(Name: "Blacephalon", types: "Fire / Ghost", DexEntry: "It slithers toward people. Then, without warning, it triggers the explosion of its own head. It's apparently one kind of Ultra Beast.", pokedexNumber: 806, RoutesFound: "Ultra Deep Sea", Weight: "13.0 kg", Height: "1.8 m"),
                                 Pokemon(Name: "Zeraora", types: "Electric", DexEntry: "It electrifies its claws and tears its opponents apart with them. Even if they dodge its attack, they'll be electrocuted by the flying sparks.", pokedexNumber: 807, RoutesFound: "Event Only", Weight: "44.5 kg", Height: "1.5 m"),
                                 Pokemon(Name: "Meltan", types: "Steel", DexEntry: "Meltan generates electricity using the metal it absorbs from outside sources. It uses this electricity as an energy source and also as an attack that can be fired from its eye.", pokedexNumber: 808, RoutesFound: "Special Research, Mystery Box", Weight: "8.0 kg", Height: "0.2 m"),
                                 Pokemon(Name: "Melmetal", types: "Steel", DexEntry: "The heavy metals in its body enable it to stay submerged indefinitely. When it's at the bottom of a lake, it creates an electric current by emitting from the antenna on its head.", pokedexNumber: 809, RoutesFound: "Evolve Meltan", Weight: "800.0 kg", Height: "2.5 m"),
                               Pokemon(Name: "Grookey", types: "Grass", DexEntry: "When it uses its special stick to strike up a beat, the sound waves produced carry revitalizing energy to the plants and flowers in the area.", pokedexNumber: 810, RoutesFound: "Starter Pokemon", Weight: "5.0 kg", Height: "0.3 m"),
                               Pokemon(Name: "Thwackey", types: "Grass", DexEntry: "It attacks with rapid beats of its stick. As it strikes with amazing speed, it gets more and more pumped.", pokedexNumber: 811, RoutesFound: "Evolve Grookey", Weight: "14.0 kg", Height: "0.7 m"),
                               Pokemon(Name: "Rillaboom", types: "Grass", DexEntry: "By drumming, it taps into the power of its special tree stump. The roots of the stump follow its direction in battle.", pokedexNumber: 812, RoutesFound: "Evolve Thwackey", Weight: "90.0 kg", Height: "2.1 m"),
                               Pokemon(Name: "Scorbunny", types: "Fire", DexEntry: "It has special pads on the backs of its feet, and one on its nose. Once it's raring to fight, these pads radiate tremendous heat.", pokedexNumber: 813, RoutesFound: "Starter Pokemon", Weight: "4.5 kg", Height: "0.3 m"),
                               Pokemon(Name: "Raboot", types: "Fire", DexEntry: "It kicks berries right off the branches of trees and then juggles them with its feet, practicing its footwork.", pokedexNumber: 814, RoutesFound: "Evolve Scorbunny", Weight: "9.0 kg", Height: "0.6 m"),
                               Pokemon(Name: "Cinderace", types: "Fire", DexEntry: "It's skilled at both offense and defense, and it gets pumped up when cheered on. But if it starts showboating, it could put itself in a tough spot.", pokedexNumber: 815, RoutesFound: "Evolve Raboot", Weight: "33.0 kg", Height: "1.4 m"),
                               Pokemon(Name: "Sobble", types: "Water", DexEntry: "When scared, this Pokémon cries. Its tears pack the chemical punch of 100 onions, and attackers won't be able to resist weeping.", pokedexNumber: 816, RoutesFound: "Starter Pokemon", Weight: "4.0 kg", Height: "0.3 m"),
                               Pokemon(Name: "Drizzile", types: "Water", DexEntry: "It's skilled at using water to its advantage. Many of its attacks are based on water, and it gets creative with the liquid as it fights.", pokedexNumber: 817, RoutesFound: "Evolve Sobble", Weight: "11.5 kg", Height: "0.7 m"),
                               Pokemon(Name: "Inteleon", types: "Water", DexEntry: "It has many hidden capabilities, such as fingertips that can shoot water and a membrane on its back that it can use to glide through the air.", pokedexNumber: 818, RoutesFound: "Evolve Drizzile", Weight: "45.2 kg", Height: "1.9 m"),
                               Pokemon(Name: "Skwovet", types: "Normal", DexEntry: "Found throughout the Galar region, this Pokémon becomes uneasy if its cheeks are ever completely empty of berries.", pokedexNumber: 819, RoutesFound: "Route 1, Route 2, Route 3", Weight: "2.5 kg", Height: "0.3 m"),
                               Pokemon(Name: "Greedent", types: "Normal", DexEntry: "Common throughout the Galar region, this Pokémon has strong teeth and can chew through the toughest of berry shells.", pokedexNumber: 820, RoutesFound: "Evolve Skwovet", Weight: "6.0 kg", Height: "0.6 m"),
                               Pokemon(Name: "Rookidee", types: "Flying", DexEntry: "This Pokémon is brave and will risk its life to save its Trainer. It's so brave, it's said, it would face off against a raging Dragonite, if its Trainer commanded it to.", pokedexNumber: 821, RoutesFound: "Route 1, Route 2, Route 3", Weight: "1.8 kg", Height: "0.2 m"),
                               Pokemon(Name: "Corvisquire", types: "Flying", DexEntry: "Smart enough to use tools in battle, these Pokémon have been seen picking up rocks and flinging them or using ropes to wrap up enemies.", pokedexNumber: 822, RoutesFound: "Evolve Rookidee", Weight: "16.0 kg", Height: "0.8 m"),
                               Pokemon(Name: "Corviknight", types: "Flying / Steel", DexEntry: "In battle, it will charge at foes at high speeds, crashing into them like a freight train. Its massive size becomes apparent when it spreads its wings.", pokedexNumber: 823, RoutesFound: "Evolve Corvisquire", Weight: "75.0 kg", Height: "2.2 m"),
                               Pokemon(Name: "Blipbug", types: "Bug", DexEntry: "Often found in gardens, this Pokémon has hairs on its body that it uses to assess its surroundings.", pokedexNumber: 824, RoutesFound: "Route 1", Weight: "8.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Dottler", types: "Bug / Psychic", DexEntry: "As it grows inside its shell, it uses its psychic abilities to monitor the outside world and prepare for evolution.", pokedexNumber: 825, RoutesFound: "Evolve Blipbug", Weight: "19.5 kg", Height: "0.4 m"),
                               Pokemon(Name: "Orbeetle", types: "Bug / Psychic", DexEntry: "It's famous for its high level of intelligence, and the large size of its brain has increased its psychic power.", pokedexNumber: 826, RoutesFound: "Evolve Dottler", Weight: "40.8 kg", Height: "0.4 m"),
                               Pokemon(Name: "Nickit", types: "Dark", DexEntry: "Aided by the soft pads on its feet, it silently raids homes and steals away valuables. It survives off its ill-gotten gains.", pokedexNumber: 827, RoutesFound: "Route 1, Route 2, Route 3", Weight: "8.9 kg", Height: "0.6 m"),
                               Pokemon(Name: "Thievul", types: "Dark", DexEntry: "With sly cunning, it tries to lure people into the woods. Some believe it to have the power to make crops grow.", pokedexNumber: 828, RoutesFound: "Evolve Nickit", Weight: "19.9 kg", Height: "1.2 m"),
                               Pokemon(Name: "Gossifleur", types: "Grass", DexEntry: "It anchors itself in the ground with its single leg, then basks in the sun. After absorbing enough sunlight, its petals spread as it blooms brilliantly.", pokedexNumber: 829, RoutesFound: "Route 3", Weight: "2.2 kg", Height: "0.4 m"),
                               Pokemon(Name: "Eldegoss", types: "Grass", DexEntry: "The seeds attached to its cotton fluff are full of nutrients. It spreads them on the wind so that plants and other Pokémon can benefit from them.", pokedexNumber: 830, RoutesFound: "Evolve Gossifleur", Weight: "2.5 kg", Height: "0.5 m"),
                               Pokemon(Name: "Wooloo", types: "Normal", DexEntry: "Its curly fleece is such an effective cushion that this Pokémon could fall off a cliff and stand right back up at the bottom, unharmed.", pokedexNumber: 831, RoutesFound: "Route 1, Route 2, Route 3", Weight: "6.0 kg", Height: "0.6 m"),
                               Pokemon(Name: "Dubwool", types: "Normal", DexEntry: "Its majestic horns are meant only to impress the opposite gender. They never see use in battle.", pokedexNumber: 832, RoutesFound: "Evolve Wooloo", Weight: "43.0 kg", Height: "1.3 m"),
                               Pokemon(Name: "Chewtle", types: "Water", DexEntry: "It starts off battles by attacking with its rock-hard horn, but as soon as the opponent flinches, this Pokémon bites down and never lets go.", pokedexNumber: 833, RoutesFound: "Route 2, Route 4, Route 5", Weight: "8.5 kg", Height: "0.3 m"),
                               Pokemon(Name: "Drednaw", types: "Water / Rock", DexEntry: "With jaws that can shear through steel rods, this highly aggressive Pokémon chomps down on its unfortunate prey.", pokedexNumber: 834, RoutesFound: "Evolve Chewtle", Weight: "115.5 kg", Height: "1.0 m"),
                               Pokemon(Name: "Yamper", types: "Electric", DexEntry: "This gluttonous Pokémon only assists people with their work because it wants treats. As it runs, it crackles with electricity.", pokedexNumber: 835, RoutesFound: "Route 2, Route 4, Route 5", Weight: "13.5 kg", Height: "0.3 m"),
                               Pokemon(Name: "Boltund", types: "Electric", DexEntry: "It sends electricity through its legs to boost their strength. Running at top speed, it easily breaks 50 mph.", pokedexNumber: 836, RoutesFound: "Evolve Yamper", Weight: "34.0 kg", Height: "1.0 m"),
                               Pokemon(Name: "Rolycoly", types: "Rock", DexEntry: "Most of its body has the same composition as coal. Fittingly, this Pokémon was first discovered in coal mines about 400 years ago.", pokedexNumber: 837, RoutesFound: "Route 3, Galar Mine No. 2", Weight: "12.0 kg", Height: "0.3 m"),
                               Pokemon(Name: "Carkol", types: "Rock / Fire", DexEntry: "It emits gas containing toxic substances from its pores. It's said that the stench can cause the uneasy feelings of those nearby to intensify.", pokedexNumber: 838, RoutesFound: "Evolve Rolycoly", Weight: "78.0 kg", Height: "1.1 m"),
                               Pokemon(Name: "Coalossal", types: "Rock / Fire", DexEntry: "It's usually peaceful, but the vandalism of mines enrages it. Offenders will be incinerated with flames that reach 2,700 degrees Fahrenheit.", pokedexNumber: 839, RoutesFound: "Evolve Carkol", Weight: "310.5 kg", Height: "2.8 m"),
                               Pokemon(Name: "Applin", types: "Grass / Dragon", DexEntry: "As soon as it's born, it burrows into an apple. Not only does the apple serve as its food source, but the flavor of the fruit determines its evolution.", pokedexNumber: 840, RoutesFound: "Route 5", Weight: "0.5 kg", Height: "0.2 m"),
                               Pokemon(Name: "Flapple", types: "Grass / Dragon", DexEntry: "It flew through the open skies over the Galar region in antiquity, carrying a sword in its mouth. In many cases, artwork featuring this Pokémon can be seen in museums.", pokedexNumber: 841, RoutesFound: "Evolve Applin", Weight: "1.0 kg", Height: "0.3 m"),
                               Pokemon(Name: "Appletun", types: "Grass / Dragon", DexEntry: "Its body is covered in sweet nectar, and the skin on its back is especially yummy. Children used to have it as a snack.", pokedexNumber: 842, RoutesFound: "Evolve Applin", Weight: "13.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Silicobra", types: "Ground", DexEntry: "It spews sand from its nostrils. While the enemy is blinded, it burrows into the ground to hide.", pokedexNumber: 843, RoutesFound: "Route 6", Weight: "7.6 kg", Height: "2.2 m"),
                               Pokemon(Name: "Sandaconda", types: "Ground", DexEntry: "Its unique style of coiling allows it to blast sand out of its sand sac more efficiently. But this also makes it less resistant to water.", pokedexNumber: 844, RoutesFound: "Evolve Silicobra", Weight: "65.5 kg", Height: "3.8 m"),
                               Pokemon(Name: "Cramorant", types: "Flying / Water", DexEntry: "It's so strong that it can knock out some opponents in a single hit, but it also may forget what it's battling midfight.", pokedexNumber: 845, RoutesFound: "Route 9, Lake of Outrage", Weight: "18.0 kg", Height: "0.8 m"),
                               Pokemon(Name: "Arrokuda", types: "Water", DexEntry: "After it's consumed enough minerals, its body transforms into something akin to armor, and it goes on a rampage.", pokedexNumber: 846, RoutesFound: "Route 2, Route 9, Lake of Outrage", Weight: "1.0 kg", Height: "0.5 m"),
                               Pokemon(Name: "Barraskewda", types: "Water", DexEntry: "When it comes to any prey it considers to be invading its territory, its water speed exceeds 60 knots.", pokedexNumber: 847, RoutesFound: "Evolve Arrokuda", Weight: "30.0 kg", Height: "1.3 m"),
                               Pokemon(Name: "Toxel", types: "Electric / Poison", DexEntry: "This Pokémon has the habit of biting anything that moves. The bigger the movement, the more it craves to bite it.", pokedexNumber: 848, RoutesFound: "Nursery", Weight: "11.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Toxtricity", types: "Electric / Poison", DexEntry: "It has a tendency to take on a lot of electrical energy and sometimes go on a rampage. It's one of the most famous Galar Pokémon.", pokedexNumber: 849, RoutesFound: "Evolve Toxel", Weight: "40.0 kg", Height: "1.6 m"),
                               Pokemon(Name: "Sizzlipede", types: "Fire / Bug", DexEntry: "It stores flammable gas in its body and uses it to generate heat. The yellow sections on its belly get particularly hot.", pokedexNumber: 850, RoutesFound: "Galar Mine No. 2", Weight: "1.0 kg", Height: "0.4 m"),
                               Pokemon(Name: "Centiskorch", types: "Fire / Bug", DexEntry: "In battle, it blows out intense flames from all over its body to intimidate opponents. It's often called the Radiator.", pokedexNumber: 851, RoutesFound: "Evolve Sizzlipede", Weight: "120.0 kg", Height: "3.0 m"),
                               Pokemon(Name: "Clobbopus", types: "Fighting", DexEntry: "It's very curious, but its means of investigating things is to try to punch them with its tentacles. The search for food is what brings it onto land.", pokedexNumber: 852, RoutesFound: "Route 9, Route 9, Lake of Outrage", Weight: "4.0 kg", Height: "0.6 m"),
                               Pokemon(Name: "Grapploct", types: "Fighting", DexEntry: "This Pokémon has mastered a set of two black belts—its thick arms. Some Pokémon trainers want to challenge it to a battle.", pokedexNumber: 853, RoutesFound: "Evolve Clobbopus", Weight: "39.0 kg", Height: "1.6 m"),
                               Pokemon(Name: "Sinistea", types: "Ghost", DexEntry: "Sinistea evolves when it absorbs a tiny bit of the life-force of a trainer or a Pokémon. It waits patiently for it's next meal while pretending to be an inanimate object.", pokedexNumber: 854, RoutesFound: "Glimwood Tangle", Weight: "0.2 kg", Height: "0.1 m"),
                               Pokemon(Name: "Polteageist", types: "Ghost", DexEntry: "Polteageist can pour its body into a teapot, from which it can produce a soothing tea. Polteageist prefers to inhabit hotels and restaurants, where it can find plenty of customers and prey.", pokedexNumber: 855, RoutesFound: "Evolve Sinistea", Weight: "0.4 kg", Height: "0.2 m"),
                               Pokemon(Name: "Hatenna", types: "Psychic", DexEntry: "Hatenna emits psychic power from the orb on its head, changing emotions in those around it. It is said that these Pokémon were discovered 50 years ago in the Glimwood Tangle forest.", pokedexNumber: 856, RoutesFound: "Glimwood Tangle", Weight: "3.4 kg", Height: "0.4 m"),
                               Pokemon(Name: "Hattrem", types: "Psychic", DexEntry: "It emits psychic power strong enough to cause headaches as a deterrent to the approach of others. For this reason, it is said to dislike being touched.", pokedexNumber: 857, RoutesFound: "Evolve Hatenna", Weight: "4.8 kg", Height: "0.6 m"),
                               Pokemon(Name: "Hatterene", types: "Psychic / Fairy", DexEntry: "Hatterene can see the emotions of creatures and humans through the fluff around its head. The fluff can sense each individual's emotions, and the whole Pokémon can become more powerful when it senses positive emotions.", pokedexNumber: 858, RoutesFound: "Evolve Hattrem", Weight: "5.1 kg", Height: "2.1 m"),
                               Pokemon(Name: "Impidimp", types: "Dark / Fairy", DexEntry: "Impidimp loves to surprise people. It hides in the darkness and then jumps out to startle others. It feeds on negative energy from the frightened reactions of its prey.", pokedexNumber: 859, RoutesFound: "Glimwood Tangle", Weight: "5.5 kg", Height: "0.4 m"),
                               Pokemon(Name: "Morgrem", types: "Dark / Fairy", DexEntry: "Morgrem's constant mischief and misdeeds resulted in it being banned from various towns. But the dogged pursuit of its true aims resulted in this Pokémon, and it remains an elusive and widely feared fairy.", pokedexNumber: 860, RoutesFound: "Evolve Impidimp", Weight: "12.5 kg", Height: "0.8 m"),
                               Pokemon(Name: "Grimmsnarl", types: "Dark / Fairy", DexEntry: "Grimmsnarl evolves from Morgrem after being exposed to a large amount of negative energy. Its large mouth hides fangs that can chew through metal.", pokedexNumber: 861, RoutesFound: "Evolve Morgrem", Weight: "61.0 kg", Height: "1.5 m"),
                               Pokemon(Name: "Obstagoon", types: "Dark / Normal", DexEntry: "Obstagoon evolved from Galarian Linoone after experiencing many fierce battles. It will take on opponents stronger than itself without fear.", pokedexNumber: 862, RoutesFound: "Evolve Galarian Linoone", Weight: "46.0 kg", Height: "1.6 m"),
                               Pokemon(Name: "Perrserker", types: "Steel", DexEntry: "Perrserker is born to be a warrior. It boasts incredible physical strength. Many Persserker hold a seal that marks them as fighters of great skill and power.", pokedexNumber: 863, RoutesFound: "Evolve Galarian Meowth", Weight: "28.0 kg", Height: "0.8 m"),
                               Pokemon(Name: "Cursola", types: "Ghost", DexEntry: "Cursola emerges when a slow-moving Pokémon passes away. Its shells are made of bones and seaweed. The bones are from other Cursola, which died from lack of nutrition.", pokedexNumber: 864, RoutesFound: "Route 9", Weight: "0.4 kg", Height: "0.3 m"),
                               Pokemon(Name: "Sirfetch'd", types: "Fighting", DexEntry: "Only Farfetch'd that have survived many battles can attain this evolution. When this Pokémon's leek withers, it will retire from combat.", pokedexNumber: 865, RoutesFound: "Evolve Galarian Farfetch'd", Weight: "117.0 kg", Height: "0.8 m"),
                               Pokemon(Name: "Mr. Rime", types: "Ice / Psychic", DexEntry: "This Pokémon can be an entertainer of great renown. It's very intelligent and has been studying how to solve various problems for over 10,000 years.", pokedexNumber: 866, RoutesFound: "Evolve Galarian Mr. Mime", Weight: "58.2 kg", Height: "1.5 m"),
                               Pokemon(Name: "Runerigus", types: "Ground / Ghost", DexEntry: "Runerigus is the evolved form of Galarian Yamask. After spending years in the desert, its mask of mud grew heavier and heavier until it became the lid of its own tomb.", pokedexNumber: 867, RoutesFound: "Evolve Galarian Yamask", Weight: "66.6 kg", Height: "1.6 m"),
                               Pokemon(Name: "Milcery", types: "Fairy", DexEntry: "Milcery releases a unique scent from its body, and any human or Pokémon that inhales it can't help but smile.", pokedexNumber: 868, RoutesFound: "Route 4", Weight: "0.3 kg", Height: "0.2 m"),
                               Pokemon(Name: "Alcremie", types: "Fairy", DexEntry: "It's capable of spinning its body so quickly, it resembles a cream tornado. It's a curious Pokémon that's very friendly toward humans.", pokedexNumber: 869, RoutesFound: "Evolve Milcery", Weight: "0.5 kg", Height: "0.3 m"),
                               Pokemon(Name: "Falinks", types: "Fighting", DexEntry: "This Pokémon is battle-hardened and strong enough to kick down a giant's castle. In times of peace, however, it throws down its arms and lifts peaceful discussions.", pokedexNumber: 870, RoutesFound: "Route 8", Weight: "62.0 kg", Height: "3.0 m"),
                               Pokemon(Name: "Pincurchin", types: "Electric", DexEntry: "It feeds on seaweed, using its teeth to scrape it off rocks. Electric current flows from the tips of its spines.", pokedexNumber: 871, RoutesFound: "Route 9, Route 9, Route 9", Weight: "1.0 kg", Height: "0.3 m"),
                               Pokemon(Name: "Snom", types: "Ice / Bug", DexEntry: "It eats snow that piles up on the ground. The more snow it eats, the bigger and more impressive the spikes on its back grow.", pokedexNumber: 872, RoutesFound: "Route 8, Route 10", Weight: "3.8 kg", Height: "0.3 m"),
                               Pokemon(Name: "Frosmoth", types: "Ice / Bug", DexEntry: "It shows no mercy to any who desecrate fields and mountains. It will fly around on its icy wings, causing a blizzard to chase offenders away.", pokedexNumber: 873, RoutesFound: "Evolve Snom", Weight: "42.0 kg", Height: "1.3 m"),
                               Pokemon(Name: "Stonjourner", types: "Rock", DexEntry: "This Pokémon is a common sight in the Galar region. It may wait motionless for days, seemingly from lost in thought, before it acts.", pokedexNumber: 874, RoutesFound: "Route 10, Route 10, Route 10", Weight: "520.0 kg", Height: "2.5 m"),
                               Pokemon(Name: "Eiscue", types: "Ice", DexEntry: "When it gets warm, the ice covering its head can melt. It tries to stay cool, but it doesn't quite succeed. On sunny days, it lands on beaches to play in the sea.", pokedexNumber: 875, RoutesFound: "Route 10", Weight: "89.0 kg", Height: "1.4 m"),
                               Pokemon(Name: "Indeedee", types: "Psychic / Normal", DexEntry: "In teams, Indeedee takes on the role of leader. It's the one that most actively stands watch, and it directs the group's movements.", pokedexNumber: 876, RoutesFound: "Bridge Field, Dappled Grove", Weight: "28.0 kg", Height: "0.9 m"),
